style.css:
@-moz-document domain("kingschool5.narod.ru"){
html, body {
background: whiteSmoke;
margin: 0;
text-shadow: 0 1px 1px white, 0 0px 1px white;
color: #333;
font-size: 13px;
font-family: 'Open Sans',arial,sans-serif;
}
table{
background: white;
border: 1px solid #E5E5E5;
}
tr {
background: #EEE;
margin: 0;
padding: 0;
}
tr:hover {
background: #F1F1F1;
}
td {
padding: 6px 0px 6px 14px;
}
a {
text-decoration: none;
color: #00479F;
}
a:hover, a:active, a:focus {
color: #D14836;
}
a font {
color: #00479F;
}
hr {
border-style: solid none none none;
border-width: 1px;
border-color: #DDD;
}
font {
color: #333;
}
td[bgcolor="#9999cc"] {
background: #F7F7F7;
}
a[href="http://www.calend.ru/"] {
display: none;
}
marquee {
display: none;
}
}
